description:
Programmable Matter: Shape Of Things To Come

Science Documentary hosted by Hod Lipson, published by TVO broadcasted as part of TVO Big Ideas series in 2011 - English narration


Information
------------------------------

Hod Lipson of Cornell University discusses the future of 3-D printing in his lecture entitled, Programmable Matter: The Shape of Things to Come. Lipson is an Associate Professor of Mechanical &amp; Aerospace Engineering and of Computing &amp; Information Science at Cornell. He is also the director of Cornell University's Creative Machines Lab (CCML). Presented on September 18, 2011

Originally broadcast on November 19, 2011

